import React from 'react'
import FooterImg from '../assets/footer.webp'
import styled from 'styled-components'

const Container = styled.footer`
    width: 100%;
    height: 50vh;
    position: relative;
    margin-top: -5em;
    background: url(${FooterImg}) no-repeat center center;
    background-size: cover;
    bottom: 0;
    content: "";
    height: 100%;
    left: 0;
    position: absolute;
    width: 100%;
    // z-index: -1; /* Place it just behind the text */

`;

const Heading = styled.h1`
    padding: 20em;
    position: relative; /* Ensure it is above the pseudo-element */
    z-index: 1; /* Ensures this text is above the pseudo-element */
`;

function Footer() {
  return (
    <Container>
        <Heading>Hello</Heading>
        <Heading>Hello</Heading>
    </Container>
  );
}

export default Footer;
